const Dashboard = () => {

    const getDashboardData = () => {
        const dashboardData = request.get(`/dashboard`, {headers: { 'x-auth-token': getToken() }})
        console.log(dashboardData);
    }

    return <div>
        <Header />
        <div className="section">
            <div className="container">
                <div className="row">
                    <div className="col-3">
                        <TaskCard title="Task Completed" type="TASK_COUNTER" />
                    </div>
                    <div className="col-3">
                        <TaskCard title="Latest Created Tasks" type="TASK_LIST" />  
                    </div>
                    <div className="col-3">
                        <TaskCard type="TASK_CHART" />
                    </div>
                </div>
            </div>
        </div>

    </div>
}

export default Dashboard;
